    false,nt"url": null,nt"notes": "This annual narrative report for Madison
    WMD outlines accomplishments during the 1989 calendar year. The report begins with
    a summary of the year's highlights and weather conditions. Land acquisition is discussed.
    The report includes a planning section which discusses compliance with environmental
    and cultural resource mandates and research and investigations. Administration is
    outlined; information about personnel, funding, safety, and technical assistance
    is given. Habitat management is also covered; subjects include wetlands, forests,
    croplands, grasslands, haying, fire management, pest control, and WPA easements.
    The wildlife section of the report discusses endangered and threatened species,
    waterfowl, marsh birds and waterbirds, raptors, game mammals, other resident wildlife,
    fisheries resources, animal control, and disease control. The public uses of the
    District described in this report include outdoor classrooms, interpretive programs,
    hunting, fishing, trapping, wildlife observation, picnicking, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, equipment utilization and replacement, computer systems,
    and energy conservation. Cooperative programs and items of interest are provided
    at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
